import React, { Component } from 'react';
import CardWithModal from '../../../components/Card/CardWithModal';

import LineChart from '../../../components/Charts/ApexChart/LineChart';

export default class TestComponent1 extends Component {
   state = {
      labels: [1, 2, 3, 4, 5, 6, 6, 78, 8, 8, 90],

      series: [
         {
            name: 'series-1',
            data: [30, 40, 45, 50, 49, 60, 70, 91]
         },
         {
            name: 'series-2',
            data: [10, 20, 30, 100, 120, 20, 10, 5]
         }
      ]
   };
   render() {
      return (
         <div>
            <CardWithModal headerText='KPI_Name'>
               <LineChart
                  labels={this.state.labels}
                  yaxis='Results'
                  series={this.state.series}
               />
            </CardWithModal>
            <CardWithModal className='mt-3'>
               <LineChart />
            </CardWithModal>
         </div>
      );
   }
}
